import React, { useEffect } from 'react'
import { useSelector, useDispatch } from 'react-redux'

const useRatingColivers = () => {
  const dispatch = useDispatch()
  const token = useSelector(s => s.user && s.user.token)
  const ratingcolivers = useSelector(s => s.ratingcolivers)
  useEffect(() => {
    const setRatingColivers = ratingcolivers => dispatch({ type: 'rating', ratingcolivers})
    fetch('http://localhost:3300/user/:id/rating-colivers', {
      headers: {
        'Authorization': 'Bearer ' + token
      }
    })
      .then(res => res.json())
      .then(data => setRatingColivers(data))
}, [token, dispatch])
  return ratingcolivers
}

const RatingColivers = () => {
  const ratingcolivers = useRatingColivers()
  if (!ratingcolivers) return 'Cargando ...'
  return (
    <ul>
      {ratingcolivers.map(ratingcoliver =>
        <li key={ratingcoliver}>
          {ratingcoliver}
        </li>
      )}
    </ul>
  )
}

export default RatingColivers
